import React, { useState } from "react";
import axios from 'axios';
import { PageHeader, Media } from "react-bootstrap";
import "./profile.css";

export default function Profile(props) {
  const [firstName, setFirstName] = useState("Kevin");
  const [lastName, setLastName] = useState("Kim");
  const [biography, setBiography] = useState("I am a computer scientist interested in learning web developement.");
  const [college, setCollege] = useState("San Jose State University");
  const [major, setMajor] = useState("Computer Science");
  const [skills, setSkills] = useState("");
  const [picture, setPicture] = useState("/profile.png");
  const [resume, setResume] = useState("");

  /*
      <div className="photo">
        <Thumbnail src={picture} />
      </div>
  */

  return (
    <div className="Profile">

      <PageHeader>Profile</PageHeader>

      <Media>
        <Media.Left>
          <img width={150} height={150} src={picture} />
        </Media.Left>
        <Media.Body>
          <Media.Heading>{firstName} {lastName}</Media.Heading>
          <h4>{college}</h4>
          <h4>{major}</h4>
          
        </Media.Body>
      </Media>

      <Tabs defaultActiveKey={2} id="uncontrolled-tab-example">
        <Tab eventKey={1} title="Tab 1">
          Tab 1 content
        </Tab>
        <Tab eventKey={2} title="Tab 2">
          Tab 2 content
        </Tab>
        <Tab eventKey={3} title="Tab 3" disabled>
          Tab 3 content
        </Tab>
      </Tabs>;

    </div>
  );
}
